import Layout from "../components/Layout";

const Paints = props => {
  return (
    <Layout>
      <div className="is-main-padding d-flex flex-wrap space-between">
        <div className="paint-container d-flex justify-center align-center">
          <img className="paint" src="/images/paint1.jpg" alt="paint" />
          <div className="paint-infos">Horizon</div>
        </div>
        <div className="paint-container middle-column d-flex justify-center align-center">
          <img className="paint" src="/images/paint2.jpg" alt="paint" />
          <div className="paint-infos">Kinaho's chief</div>
        </div>
        <div className="paint-container d-flex justify-center align-center">
          <img className="paint" src="/images/paint3.jpg" alt="paint" />
          <div className="paint-infos">Profondeur</div>
        </div>
        <div className="paint-container d-flex justify-center align-center">
          <img className="paint" src="/images/paint4.jpg" alt="paint" />
          <div className="paint-infos">Homard</div>
        </div>
        <div className="paint-container middle-column d-flex justify-center align-center">
          <img className="paint" src="/images/paint5.jpg" alt="paint" />
          <div className="paint-infos">Bluewagoon</div>
        </div>
        <div className="paint-container d-flex justify-center align-center">
          <img className="paint" src="/images/paint6.jpg" alt="paint" />
          <div className="paint-infos">Cocorico</div>
        </div>
        <div className="paint-container d-flex justify-center align-center">
          <img className="paint" src="/images/paint7.jpg" alt="paint" />
          <div className="paint-infos">L'indienne</div>
        </div>
      </div>
      <style jsx>
        {`
          .paint-container {
            width: calc((100% - 40px) / 3);
            height: calc((100% - 40px) / 3);
            margin-bottom: 20px;
            position: relative;
          }
          .paint {
            width: 100%;
            transition: 0.2s;
          }
          .paint:hover {
            filter: contrast(2) brightness(0.7);
            transition: 0.2s;
          }
          .middle-column {
            margin: 0 20px 20px 20px;
          }
          .paint-infos {
            color: white;
            font-weight: bold;
            position: absolute;
            padding: 10px;
            border: 2px solid white;
            background-color: rgba(0, 0, 0, 0.4);
          }
        `}
      </style>
    </Layout>
  );
};

export default Paints;
